/*eslint-disable no-undef*/
import "./Home.css";
import React from "react";
import { Link } from "react-router-dom";

class Home extends React.Component {
  state = {
    isLogin: false,
  };
  loginWithKakao = () => {
    try {
      return new Promise((resolve, reject) => {
        if (!Kakao) {
          reject("Kakao 인스턴스가 존재하지 않습니다.");
        }
        Kakao.Auth.login({
          success: (auth) => {
            console.log("정상적으로 로그인 되었습니다.", auth);
            this.setState({
              isLogin: true,
            });
          },
          fail: (err) => {
            console.error(err);
          },
        });
      });
    } catch (err) {
      console.error(err);
    }
  };

  logoutWithKakao = () => {
    if (Kakao.Auth.getAccessToken()) {
      console.log(
        "카카오 인증 액세스 토큰이 존재합니다.",
        Kakao.Auth.getAccessToken()
      );
      Kakao.Auth.logout(() => {
        console.log("로그아웃 되었습니다.", Kakao.Auth.getAccessToken());
        this.setState({
          isLogin: false,
        });
      });
    }
  };
  componentDidMount() {
    console.log("componentDidMount 가 실행되었습니다.");
    Kakao.init("b7c5cb9042af5754b5af32fa54b1a96e");
    if (Kakao.Auth.getAccessToken()) {
      console.log("랙세스 토큰이 존재합니다. 세션을 유지합니다.");
      this.setState({
        isLogin: true,
      });
    }
  }

  render() {
    const { isLogin } = this.state;

    console.log(this.props);

    const loginView = (
      <div id="header_nav_confirm_off">
        <div className="header_nav_menuitem">
          <a className="nav_link" href="#" onClick={this.loginWithKakao}>
            로그인(카카로)
          </a>
        </div>
        <div className="header_nav_menuitem">
          <a className="nav_link" href="#">
            회원가입(카카오)
          </a>
        </div>
      </div>
    );

    const mainView = (
      <div id="header_nav_confirm_on">
        <div className="header_nav_menuitem">
          <a className="nav_link" href="#" onClick={this.logoutWithKakao}>
            로그아웃
          </a>
        </div>
        <div className="header_nav_menuitem">
          <a className="nav_link" href="#">
            마이페이지
          </a>
        </div>
      </div>
    );

    return (
      <header>
        <nav>
          <div className="header_nav_home">SSAFY 스터디 그룹 매칭 서비스</div>
          <div className="header_nav_menu">
            <div className="header_nav_menuitem">
              <div className="nav_link">공지사항</div>
            </div>
            <Link to="/Table">
              <div className="header_nav_menuitem">
                <div className="nav_link">게시판</div>
              </div>
            </Link>
            <Link to="/MapHome">
              <div className="header_nav_menuitem">
                <div className="nav_link">지도로 찾기</div>
              </div>
            </Link>
            <div className="header_nav_menuitem">
              <div className="nav_link">일단 하나</div>
            </div>
            {isLogin ? mainView : loginView}
          </div>
        </nav>
      </header>
    );
  }
}

export default Home;
